import React, {useState} from 'react'

function AddNewVideo() {
   const [video, setVideo] = useState([]);

   const handleAddVideo = (e) => {
    setVideo(e.target.value)
   }



  return (
    <div>
     <handleAddVideo />
    </div>
  );
}

export default AddNewVideo;
